import{_ as e,o as t,c as i,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 23.1-1239 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-1239.md","filePath":"vacode/23.1-1239.md"}'),a={name:"vacode/23.1-1239.md"},o=n('<h1 id="§-23-1-1239-definitions" tabindex="-1">§ 23.1-1239 Definitions. <a class="header-anchor" href="#§-23-1-1239-definitions" aria-label="Permalink to &quot;§ 23.1-1239 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Designated reviewers&quot; means the Secretaries of Education and Finance, the director of the Department of Planning and Budget, the director of the Council, the president of the Virginia Economic Development Partnership, and the staff directors of the House Committee on Appropriations and the Senate Committee on Finance and Appropriations, or their designees.</p><p>&quot;Eligible degree&quot; means a new bachelor&#39;s or master&#39;s degree, or a certificate issued by a baccalaureate public institution of higher education in association with a bachelor&#39;s degree, in the field of computer science, computer engineering, or other closely related fields of study, or that otherwise aligns with traded-sector, technology-focused growth opportunities identified by the Virginia Economic Development Partnership Authority.</p><p>&quot;Fund&quot; means the Tech Talent Investment Fund.</p><p>&quot;Grant&quot; means a grant paid from the Tech Talent Investment Fund.</p><p>&quot;Memorandum of understanding&quot; means the negotiated instrument entered into by a qualified institution and the Commonwealth, regardless of whether the terms of the memorandum of understanding are encompassed or included within any other institutional partnership or performance agreement required by law. A memorandum of understanding shall contain criteria for eligible degrees, eligible expenses, and degree production goals for a period ending in 2039.</p><p>&quot;New bachelor&#39;s and master&#39;s degrees&quot; means the awarding of eligible degrees produced by a qualified institution to meet the degree production goals set forth in a qualified institution&#39;s memorandum of understanding.</p><p>&quot;Qualified institution&quot; means (i) any associate-degree-granting public institution of higher education, as defined in § <a href="/vacode/23.1-100/">23.1-100</a>, that has a transfer plan that culminates in an eligible degree and (ii) any baccalaureate public institution of higher education, as defined in § <a href="/vacode/23.1-100/">23.1-100</a>.</p><p>2019, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0638" target="_blank" rel="noreferrer">638</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0639" target="_blank" rel="noreferrer">639</a>.</p>',10),r=[o];function s(d,c,u,h,l,p){return t(),i("div",null,r)}const m=e(a,[["render",s]]);export{g as __pageData,m as default};
